import React, {useEffect, useState} from 'react'
import iconactive from '../images/iconactive.png';
import iconloan from '../images/iconloan.png';
import iconsavings from '../images/iconsavings.png';
import iconusers from '../images/iconusers.png';
import threeline from '../images/threeline.png';
import threedot from '../images/threedot.png';
import prev from '../images/prev.png';
import next from '../images/next.png';
import '../styles/user.scss'
import realdropdown from '../images/Realdropdown.png'

const Users = () => {
    // interface Data {
    //     id: number
    //     value: string
    // }
    const [users, setUsers] = useState([])
    const [count, setCount] = useState({start: 0, end: 10})

    let getTime = (post: Date) => {
        return new Date(post).toLocaleDateString()
    }

    // const setPage = (id: number) => {
    //     if (id >= count.start && id<= count.end) {
    //     }
    // }

    // const changeCount = () => {
    //     setCount(prevCount => {
    //         ...prevCount, prevCount.start: += 10, prevCount.end: += 10
    //     })
    // }
    

    useEffect(()=> {
        const getUsers = async (): Promise<any> => {
            let response = await fetch('https://6270020422c706a0ae70b72c.mockapi.io/lendsqr/api/v1/users')
            let data = await response.json()
            setUsers(data)
        }
        getUsers()
        console.log(users)
    }, [])

return (
    <div className='userss'>
        <h1>Users</h1>
        <div className='userss-index'>
            <div className='userss-index-section'>
                <img src={iconusers} alt="iconusers" />
                <p>USER</p>
                <h3>2,453</h3>
            </div>
            <div>
                <img src={iconactive} alt="iconactive" />
                <p>ACTIVE USER</p>
                <h3>2,453</h3>
            </div>
            <div>
                <img src={iconsavings} alt="iconsavings" />
                <p>USERS WITH LOAN</p>
                <h3>12,453</h3>
            </div>
            <div>
                <img src={iconloan} alt="iconloan" />
                <p>USERS WITH SAVINGS</p>
                <h3>102,453</h3>
            </div>
        </div>
        <table>
            <thead>

            <tr>
                <th> 
                    <span>ORGANIZATION<img src={threeline} alt="filter" /></span>
                </th>
                <th>
                    <span>USERNAME<img src={threeline} alt="filter" /></span>
                </th>
                <th>
                    <span>EMAIL<img src={threeline} alt="filter" /></span>
                </th>
                <th>
                    <span>PHONE NUMBER<img src={threeline} alt="filter" /></span>
                </th>
                <th>
                    <span>DATE JOINED<img src={threeline} alt="filter" /></span>
                </th>
                <th>
                    <span>STATUS<img src={threeline} alt="filter" /></span>
                </th>
            </tr>
            </thead>
            <tbody>
                {users.map((user) => {
                    const {orgName, userName, email, phoneNumber, createdAt, lastActiveDate, id} = user
                    if (id >= count.start && id<= count.end) {
                        {
                                return (
                                <tr key={id}>
                                <td>{orgName}</td>
                                <td>{userName}</td>
                                <td>{email}</td>
                                <td>{phoneNumber}</td>
                                <td>{getTime(createdAt)}</td>
                                <td>{getTime(lastActiveDate)} <img src={threedot} alt="threedot" height='20px' width='20px' /></td>
                                </tr>)
                            }
                                            }
                })}
            
            </tbody>
        </table>
        <div className='index'>
            <h1>Showing</h1>
            <h2>10 <span><img src={realdropdown} alt="dropdown" /></span>{users.length}</h2>
            <div>
                <img src={prev} alt="prev" />1 2 3 ... 15 16 <img onClick={changeCount} src={next} alt="next" />
            </div>
        </div>
    </div>
)
}

export default Users
